import React from 'react';
import { StyleSheet, Text, View, Button, Image, SafeAreaView, TouchableOpacity, ScrollView} from 'react-native';
import { Col, Row, Grid } from "react-native-easy-grid";

const SettingsScreen = ({navigation}) => {
    return(
        <SafeAreaView style={Styles.container}>
            <Text>Settings Screen</Text>
            <Grid style={{height: 50}}>
                <View>
                    <TouchableOpacity>
                        <Row style={{backgroundColor: '#273471', height: 50, minHeight: 50, maxHeight: 50}}>
                            <Text>Hi</Text>
                        </Row>
                    </TouchableOpacity>
                </View>
                <View>
                    <TouchableOpacity>
                        <Row style={{backgroundColor: '#927461', height: 50, minHeight: 50, maxHeight: 50}}>
                            <Text>Hi</Text>
                        </Row>
                    </TouchableOpacity>
                </View>
            </Grid>
        </SafeAreaView>
    );
};



export default SettingsScreen;

const Styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#08F1ED'
    },
});
